import React from 'react';
import './App.css'; // Make sure to import your CSS file
import AutoCompleteTextBox from './components/AutoCompleteTextBox'; // Import the component we created earlier

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Country Autocomplete</h1>
        <AutoCompleteTextBox />
      </header>
    </div>
  );
}

export default App;
